import React from "react"
import Navbar from "./Navbar"
import Home from "./Home"
import footer from "./"


class Main extends React.Component{

    render() {
        return(
            <div>
                <Navbar/>
                <Home/>
                <footer/>
            </div>
        )
    }
}

export default Main;
